import React from 'react';
import SafetySection from './safety';
import InfoSection from './info';
import ExpenseSection from './expense-tracker';
import ArchitectureSection from './architecture';

const CorporateContent = ({data}) => {
    return(
        <>
        <InfoSection backgroundImage={data.corporatePage.infoSectionImage} title={data.infoSectionTitle} subTitle={data.infoSectionSubTitle} contents={data.corporateInfos}/>
        <SafetySection title={data.safetySectionTitle} subTitle={data.safetySectionSubTitle} contents={data.corporateSafeties}/>
        <ArchitectureSection title={data.architectureSectionTitle} subTitle={data.architectureSectionSubTitle} contents={data.corporateSafeties}/>
        <ExpenseSection title={data.expenseTrackerSectionTitle} subTitle={data.expenseSectionSubTitle} contents={data.corporateExprenses}/>
        </>
    );
}

export default CorporateContent;
